    'pagetitle' => 'Строительные блоки',
    'longtitle' => 'Основа современного строительства - керамзитобетонные и бетонные блоки для возведения стен и перегородок',
    'description' => 'Производство строительных блоков  – это одно из направлений работы нашего завода вибропрессованных изделий LATERES',
    'alias' => 'bloki',
    'link_attributes' => '',
    'published' => 1,
