    'isfolder' => 1,
    'introtext' => 'блоки,           строительные блоки,           перегородочные блоки,           керамзитобетонные блоки,           бетонные блоки',
    'content' => '<p>Работа с нами, это возможность<strong> купить строительные блоки </strong>недорого, без посредников и переплат. На сегодняшний день, <strong>производство строительных блоков</strong> на заводе перешло на новый, более высокий уровень. Автоматизация процесса, позволила выпускать качественные <strong>блоки строительные, цена</strong> которых стала более доступной.<br />Удобный в работе <strong>стеновой блок</strong> сегодня наиболее востребован в строительстве на дачах и приусадебных участках. У нас <strong>блок стеновой </strong>представлен в полном ассортименте. Завод предлагает <strong>стеновые блоки</strong>, в том числе <strong>блоки стеновые бетонные</strong>, качественный <strong>блок фундамент</strong> и прочее, напрямую с производства.<br />Теперь <strong>фундаментный блок</strong>, выгодный в дачном строительстве <strong>блок фбс</strong>, любой <strong>блок строительный</strong>, в том числе самый ходовой <strong>блок 20х20х40</strong>, надежные <strong>перегородочные блоки</strong> можно приобрести прямо здесь.<br /><strong>Керамзитобетонные блоки, цена </strong><em>доступна для всех.</em><br />Один из самых популярных материалов <strong>керамзитоблок</strong>, всегда есть в наличии.  Весь <strong>керамзитный блок</strong> изготовлен на нашем заводе и доступен без посредников. Приобретая <strong>керамзитовый блок </strong>или <strong>керамзито-песчаные блоки</strong>, а также<strong> бетонные блоки</strong> и другие товары у нас, вам не нужно переплачивать.<br />Представленные <strong>бетонные блоки, купить</strong> которые теперь можно прямо на сайте, соответствуют всем требованиям. Для наших клиентов качественные <strong>бетонные блоки, цена</strong> на которые ниже средней по региону, востребованные <strong>бетонные блоки 20х20х40</strong>, практичный <strong>блок пустотелый бетонный </strong>и другие материалы всегда доступны на сайте. Для постоянных и оптовых клиентов существуют специальные скидки и предложения.<br /><strong>Строительные блоки – основа современного строительства</strong><br /><strong>Производство строительных блоков</strong> – это одно из направлений работы нашего завода. В зависимости от того, какие фундаментные или <strong>стеновые блоки</strong> необходимы нашим заказчикам, мы готовы предложить, как <strong>строительные блоки</strong>, изготовленные по ГОСТам, и по индивидуальным проектам. Мы производим блоки стеновые бетонные, которые обладают высокими показателями теплоизоляции и удобством монтажа. В нашем каталоге представлены блоки строительные, цена которых невысока, используемые строительстве различных масштабов, как в частном, так и промышленном. Если необходим блок фбс, блок 20х20х40 или блок строительный, то мы готовы предоставить их в любом необходимом заказчику объеме. Мы гарантируем, что <strong>фундаментный блок</strong> (блок-фундамент) или блок стеновой полностью отвечают стандартам и изготовлены только из высококачественных материалов.<br /><strong>Блоки из керамзитбетона</strong> – недорого и качественно<br />В последние несколько лет все более востребованными становятся <strong>керамзитобетонные блоки</strong>, цена которых немного выше, чем у бетонных, но при этом керамзитный блок обладает меньшим весом и меньшим коэффициентом теплопроводности. На наших производственных мощностях можно изготовить керамзито-песчаные блоки с содержанием керамзита 30% или 90% (требования ГОСТ), поэтому каждый наш заказчик сможет найти тот <strong>керамзитовый блок</strong>, который оптимален для того или иного строительства. Мы предлагаем керамзитоблоки различных форм, которые могут использоваться и в качестве основы для строительства зданий и сооружений различного назначения.<br /><strong>Бетонные блоки</strong> для частного или промышленного строительства</p>',
